import React, { Component } from 'react';
import './App.css';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      data: null,
      userList: []
    };
  }
    componentDidMount(){
      fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(data => this.setState({data}))
      .then(console.log(this.state.data))
    }
  render(){
    return (
      <div className="App">
        <div>
          <h1>Users List</h1>

        </div>
      </div>
    );
  }
}

export default App;
